import React from "react";
import './apartado.css'
import { useState } from "react";

function Apartado(){
    const [texto,setTexto] = useState('')
    return(
        <div className="apartado11">
            <div>
                <div className="title-apartado-cont">
                    <button type="button" className="title-apartado">About me</button>
                    <button type="button" className="title-apartado">Skills</button>
                    <button type="button" className="title-apartado">Education</button>
                </div>
                <div className="contenedor-apartado">
                    <p className="p-apartado">{texto}</p>
                </div>
            </div>
        </div>
    )
}

export default Apartado;
